const LOGIN = Object.freeze({
  BASE_URL: "http://localhost:8080",
});

const SESSION = Object.freeze({
  SESSION_TOKEN: "sessionToken",
  TOKEN_FAILURE: "Token_Failure",
  LOGGED_OUT: "Logged_Out",
});

export { LOGIN, SESSION };
